    report, item 1, 2, and 5 have been corrected.  Item 4 represents payment on a
    charge card issued by the Committee's bank for transactions that do not all occur
    in the current period, each of which is otherwise individually disclosed as to
    the ultimate payee.  With respect to item #3, this committee engaged in best efforts
    to obtain the identification information of donors.  First, online solicitation
    and donation pages include clear and conspicuous request for such information,
    inform contributors of the requirement of federal law for reporting such information,
    and is a required field to complete donations. Second, online contributors who
    did not provide such information or use non-compliant answers receive at least
    one email requesting that information through an online page that clearly asks
    for the missing information, without a solicitation, and informs the contributor
    of the requirements of federal law for the reporting of such information.  Third,
    contributors by mail (this Committee only solicits via its website) without the
    information receive at least one follow-up, stand alone effort by mail to obtain
    this information, without a solicitation, informing contributors of the requirements
    of federal law for the reporting of such information, and included a pre-addressed
    return envelope and a URL to provide the information.\n"
